import React,{Component} from "react";
const numbers = [1,2,3,"kek"];

class Template extends Component{

    render() {
        // const kek =
        const full = this.props.cont.map((x,index)=>
        {
            return (
                    <tr key={index}>
                        <td>{x.display_url}</td>
                    </tr>
            );
        });
        return full;

}
}
export default Template;
